description:
Released in Japan on VHS only, and highly collectible. HARDSUBBED in English.

While Mario is playing Nintendo, Princess Peach pops out of the TV chased by Koopa and with irritating Japanese screams demands Mario save her. So he vow to do just that, and while at work (at a grocey/hardware store??) Mario and his brother are summoned to Mushroom Land and embark on a journey to save the princess.

This is basically an hour long film of the Super Mario Bros. Famicom game (Super Mario Brothers 1 for the NES), will all the goombas, koopa troopas, piranha plants and Bowsers you could ask for. For those of you who haven't been living under a rock will know what to expect. Except for Luigi's strange yellow shirt and super-greedy characteristics. and that weird dog thing. and the fact that Peach is a screeching harpy...

